import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Portfolio from "./pages/portfolio";

function App() {
  return (
    <div className="App">
      <Router>
        <UserProvider>
          <Routes>
            <Route exact path="/" element={<Portfolio />} />
          </Routes>
        </UserProvider>
      </Router>
    </div>
  );
}

export default App;
